import { useState } from "react";

function SecondTable({pendingCars}){

    const [cars,setCars] = useState({anme:'',mdoel:''});

    use
    return(
        <div>
            <table>
                <tr>
                    <th>Name</th>
                    <th>Model</th>
                    <th>Action</th>
                </tr>
                {pendingCars.map((data)=>(
                    <tr>
                        <td>{data.name}</td>
                        <td>{data.model}</td>
                    </tr>
                ))
                }
            </table>
        </div>
    )
}
export default SecondTable;
